import React from 'react';
import logo from '../../assets/logo.svg';
import './About.css';

function About() {
    return (
        <div className="App">
                <img src={logo} className="App-logo" alt="logo" />
                <h1>About the Team Page</h1>
        </div>
    );
}

export default About;
